import React, { useState, useEffect } from 'react';
import MyPurchasedPresenter from './MyPurchasedPresenter';
import { usersApi } from 'api';
import Loader from 'Components/Loader';

const MyPurchasedContainer = () => {
  const [purchasedData, setPurchasedData] = useState({
    purchased: null,
  });
  const [error, setError] = useState(null);
  const [loading, setLoading] = useState(true);

  const getData = async () => {
    try {
      const { data: purchased } = await usersApi.purchasedList();
      setPurchasedData({
        purchased: purchased,
      });
    } catch {
      setError("Can't find anything.");
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    getData();
  }, []);

  const { purchased } = purchasedData;

  return loading ? (
    <Loader />
  ) : (
    <MyPurchasedPresenter purchased={purchased} error={error} />
  );
};

export default MyPurchasedContainer;
